Les poissons sont des animaux vertébrés aquatiques à branchies, pourvus de nageoires et dont le corps est le plus souvent couvert d'écailles. On les trouve abondamment aussi bien dans les eaux douces que dans les mers : on trouve des espèces depuis les sources de montagnes (omble de fontaine, goujon) jusqu'au plus profond des océans (grandgousier, poisson-ogre). Leur répartition est toutefois très inégale : 50 % des poissons vivraient dans 17 % de la surface des océans (qui sont souvent aussi les plus surexploités). Ils ont un rôle fondamental pour les hommes : 
*  en tant que nourriture, partout dans le monde ; qu'ils soient pêchés dans la nature ou élevés en pisciculture ; 
*  ils sont aussi exploités à des fins récréatives, avec la pêche et l'aquariophilie, et sont parfois exposés dans de grands aquariums publics ; 
*  ils jouent et ont joué un rôle significatif dans de nombreuses cultures, en tant que déités et symboles religieux, ou sujets de contes, légendes, livres et films ; 
*  en jouant un rôle écosystémique important ; 
*  en contribuant aux cycles biogéochimiques, dont le cycle du carbone et en particulier en contribuant au puits de carbone océanique. Dans la classification phylogénétique, obtenue par application des méthodes cladistiques, le groupe des poissons est paraphylétique. La classe des Poissons (Pisces) de la classification classique est obsolète. Les espèces actuelles (non-éteintes) de poissons sont réparties dans les taxons Actinoptérygiens (les plus communs), Chondrichtyens (les raies et requins), Dipneustes, Actinistiens, Myxinoïdes et Pétromyzontides. Le premier inventaire ichtyologique de France semble être celui de Belon P., en 1555, intitulé La nature et la diversité des poissons avec leurs pourtraicts représentés au plus près du naturel.
